INSERT INTO `department` (`id`, `name`, `description`, `time`, `photo`) VALUES
(1, 'Neurology', 'We have a great Neurology department with best doctors, staff and instruments. Neurology is the branch of medicine concerned with the study and treatment of disorders of the nervous system. The nervous system is a complex, sophisticated system that regulates and coordinates body activities. It has two major divisions: Central nervous system: the brain and spinal cord.', 'Monday - 10am to 5pm', );
INSERT INTO `department` (`id`, `name`, `description`, `time`, `photo`) VALUES
(2, 'Dentistry', 'We have a great Dentistry department with best Dentist, staff and instruments. dentistry, the profession concerned with the prevention and treatment of oral disease, including diseases of the teeth and supporting structures and diseases of the soft tissues of the mouth. Dentistry also encompasses the treatment and correction of malformation of the jaws, misalignment of the teeth, and birth anomalies of the oral cavity such as cleft palate. In addition to general practice, dentistry includes many specialties and subspecialties, including orthodontics and dental orthopedics, pediatric dentistry, periodontics, prosthodontics, oral and maxillofacial surgery, oral and maxillofacial pathology, endodontics, public health dentistry, and oral and maxillofacial radiology', 'Sunday - 10am to 6pm', );
INSERT INTO `department` (`id`, `name`, `description`, `time`, `photo`) VALUES
(4, 'Surgery Department', 'The department of general surgery takes special interest in MIS, hepato- biliary, pancreatic, esophageal, colorectal complex abdominal, breast and endocrine surgery. Surgeons are almost ready to offer kidney transplantation and preparing for liver transplantation in near future. Medicine and surgery have become sufficiently complicated that some expertise is appropriate for quality of care. The concept of a surgical team is relatively new but effective means to attain excellence. Surgeons here work in a team which consists not only of consultant colleagues but also of a multidisciplinary group to deliver the best combination of care for the individual. Modern surgery has undoubtedly helped to cure diseases, alleviate suffering and prolonging life. Through its ever advancing horizons, surgical practice in the world continues to conquer new disease and bring more benefits to mankind. We wish to bring those benefits to our long suffering citizens. We want our patient’s experience in Square Hospital as pleasant and as comfortable as possible.', 'Monday - 10am to 5pm', );

